def insert():
    models.Variant.objects.all().delete()
    models.ModelNumber.objects.all().delete()
    models.BrandName.objects.all().delete()

    for i in brandname:
        brand = models.BrandName(name=i)
        brand.save()
    
    for i in modelName:
        brand = models.BrandName.objects.get(name = i.get('brand_id'))
        model = models.ModelNumber(brandID = brand, name=i.get('name'))
        model.save()
        
    for i in varint:
        model = models.ModelNumber.objects.get(name = i.get('id'))
        varintData = models.Variant(modelNumberId = model, ram = i.get('ram'), storage = i.get('storage'))
        varintData.save()